import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import ListItemAvatar from '@material-ui/core/ListItemAvatar';
import Avatar from '@material-ui/core/Avatar';
import Html5 from './images/Html5.jpg';
import Css3 from './images/Css3.jpg';
import JavascriptReact from './images/JavascriptReact.jpg';
import Redux from './images/Redux.jpg';
import NodeJs from './images/NodeJs.jpg';
import MySql from './images/MySql.jpg';
import Git from './images/Git.jpg';
import Scrum from './images/Scrum.jpg';
import Adaptabilite from './images/Adaptabilite.jpg';
import Curiosite from './images/Curiosite.jpg';
import Patience from './images/Patience.jpg';
import Rigueur from './images/Rigueur.jpg';
import Perseverance from './images/Perseverance.jpg';
import Relationnel from './images/Relationnel.jpg';
import Grid from '@material-ui/core/Grid';
import './App.css';

const styles = theme => ({
  root: {
    width: '100%',
    maxWidth: 360,
    backgroundColor: 'transparent',
    margin: 'auto auto'    
  },
  inline: {
    display: 'inline',
  },
});

function HardSkills(props) {
  const { classes } = props;
  return (
    <List className={classes.root}>
    <Grid container spacing={16}>
    <Grid item xs={12} md={6}>
      <ListItem alignItems="flex-start">
        <ListItemAvatar>
          <Avatar alt="Remy Sharp" src={Profil} />
        </ListItemAvatar>
        <ListItemText><p className='TexteSkills'>HTML5</p></ListItemText>
          </ListItem>
          <ListItem alignItems="flex-start">
        <ListItemAvatar>
          <Avatar alt="Remy Sharp" src={Profil} />
        </ListItemAvatar>
        <ListItemText><p className='TexteSkills'>CSS3</p></ListItemText>
          </ListItem>
          <ListItem alignItems="flex-start">
        <ListItemAvatar>
          <Avatar alt="Remy Sharp" src={Profil} />
        </ListItemAvatar>
        <ListItemText><p className='TexteSkills'>Javascript/React</p></ListItemText>
          </ListItem>
          <ListItem alignItems="flex-start">
        <ListItemAvatar>
          <Avatar alt="Remy Sharp" src={Profil} />
        </ListItemAvatar>
        <ListItemText><p className='TexteSkills'>Redux</p></ListItemText>
          </ListItem>
          </Grid>
          <Grid item xs={12} md={6}>
          <ListItem alignItems="flex-start">
        <ListItemAvatar>
          <Avatar alt="Remy Sharp" src={Profil} />
        </ListItemAvatar>
        <ListItemText><p className='TexteSkills'>Node.js</p></ListItemText>
          </ListItem>
          <ListItem alignItems="flex-start">
        <ListItemAvatar>
          <Avatar alt="Remy Sharp" src={Profil} />
        </ListItemAvatar>
        <ListItemText><p className='TexteSkills'>MySQL</p></ListItemText>
          </ListItem>
          <ListItem alignItems="flex-start">
        <ListItemAvatar>
          <Avatar alt="Remy Sharp" src={Profil} />
        </ListItemAvatar>
        <ListItemText><p className='TexteSkills'>Git</p></ListItemText>
          </ListItem>
          <ListItem alignItems="flex-start">
        <ListItemAvatar>
          <Avatar alt="Remy Sharp" src={Profil} />
        </ListItemAvatar>
        <ListItemText><p className='TexteSkills'>Scrum</p></ListItemText>
          </ListItem>
          </Grid>         
          </Grid>
         </List>    
 );
}

HardSkills.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(HardSkills);
